import React from 'react';
import DeleteOutlinedIcon from '@material-ui/icons/DeleteOutline';


const Note = (props) => {
    const deleteNote = () =>{
        props.deleteItem(props.id);
    }
    return (
        <>
            <div className='note'>
                <h1>{props.title}</h1>
                <br />
                <p>{props.content}</p>
                <button onClick={deleteNote} className="btn ">
                    <DeleteOutlinedIcon />
                </button>

            </div>
        </>
    )
}

export default Note;
